import React, { Fragment } from "react";
import { Todo } from "./Todo";
import styled from "styled-components";

export const TodoListSection = styled.section`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: 10px 0px;

  position: absolute;
  width: 335px;
  height: 242px;
  left: 1262px;
  top: 330px;

  background: #e3f8ff;
  border-radius: 15px;
`;

export const ListUl = styled.li`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: 0px;

  width: 335px;
  height: 184px;
`;

export const TodoList = () => {
  return (
    <Fragment>
      <TodoListSection>
        <div>
          <h1>{"공부"}</h1>
          <button>:</button>
        </div>
        <ListUl>
          <Todo></Todo>
        </ListUl>
      </TodoListSection>
    </Fragment>
  );
};
